(23, 2, '11', '1201RL', '<p>1 tightly round ground needles for liner. Textured needles hold a LOT more ink. By not polishing the entire taper of the needle, the needle will be able to hold more ink. 0,35 mm Diameter Textured Super Long Taper 5.5 mm taper length </p><p>The Needles are made of Medical Grade High Quality 316L Surgical Stainless Steel. Using the best quality stainless steel will prevent the needles from curling, and give your art the respect it deserves. Perfect Needle </p><p>Taper After extensive research with professional artists, we have found the perfect needle taper for the most efficient ink flow into the skin. 50 Needles per box. </p><p>All of our needles are made to these specifications<strong> E.O GAS STERILIZED. PACKED WITH STERILIZATION INDICATION <font color=\"#0000FF\">BLUE DOT</font>.</strong></p>', 'Round Liner , 1201RL , 1RL', 'Round Liner , 1201RL , 1RL', 40, NULL, NULL, 'BOX', NULL, 120, 0, 1, '01', '01', 1, 1, 1, NULL, '2021-03-12 15:02:31', NULL),
