(25, 2, '16', '1205RL', '<p> 1.Pre-made, sterilized, individually blister packaged and ready to use.</p><p>\r\n</p><p>\r\n	2.Highest quality, sterile, per-soldered, ready made, on the bar tattoo needles.</p>\r\n<p>\r\n	3.Made from ISO 9001 certified Stainless Steel.</p>\r\n<p>\r\n	4.All needles have been thoroughly inspected for hooks and burs.</p>\r\n<p>\r\n	5.Sterilized by E.O Gas. CE Marked and approved for use in Europe.</p>\r\n<p>\r\n	6.Professional tattoo needle, professional medical equipment factory, color fast, uniform alignment</p><p>7. 50 Needles per box.</p><p></p>', 'Round Liner , 1205RL , 5RL', 'Round Liner , 1205RL , 5RL', 40, NULL, NULL, 'BOX', '', 0, 0, 1, '01', '01', 1, 1, 1, NULL, NULL, NULL),
