(49, 2, 'S49', 'Spirit Thermal Paper', 'Thermal Paper has 4 parts. \r\n\r\n1) Top layer is white. This is the layer that your image will be transferred onto. \r\n2) Second Layer is not bound and is a milky white. Typically this layer is thrown away. \r\n3) Third Layer is the Carbon (purple/blue paper). By pressing on this layer the purple/blue coating is transferred to the upper sheet. \r\n4) Fourth bottom sheet is yellow and holds the original in place when using a stencil copy machine.', 'Spirit Thermal Paper , Transfer paper', 'Spirit Thermal Paper , Transfer paper', 25, NULL, NULL, 'EACH', NULL, 30, 0, 1, '01', '01', 1, 1, 1, NULL, '2020-11-04 04:57:56', NULL),
