(156, 2, '', '1205RM', '<p>Round magnums &nbsp;are a fairly new version of the magnum needle. Round magnums are arranged so that the tips arch at the center. The concept is that this rounded edge conforms better to the skin, giving a more consistent line, better ink dispersion and doing less skin damage.&nbsp;5RM is a 5 needle magnum with 5 needles to the bar and the rounded arrangement of points.The 5RM is&nbsp;commonly used for small lines,detail work and intricate shading.</p>', '', '', 42, NULL, NULL, 'BOX', '', 155, 0, 1, '01', '01', 1, 1, 1, NULL, NULL, NULL),
