(178, 2, 'FTA--46', 'Stainless Steel Arm Rest', '<p>The jewel in any studio. This luxurious arm rest is made with 3.16L stainless steel and is perfect for any studio use.</p><p>Easy to clean with multiple adjustment and setting, your job just got easier.&nbsp;</p><p><br></p><p>Specification:</p><p>Weight: 1.9KG</p><p>Height: 66-100cm</p><p>Material: Stainless Steel</p>', '', '', 53, NULL, NULL, 'EACH', '', 0, 0, 1, '01', '01', 1, 1, 1, NULL, NULL, NULL),
(179, 2, '', 'Dr. Pen Ultima A1', '<h5>Beautiful Skin Like Never Before</h5><p>Dr Pen Auto Microneedle System is a revolutionary micro-needling device which aims to tighten, lift and rejuvenate skin and benefits include:</p><ul><li>Safer and more effective in piercing the skin than traditional skin needling rollers</li><li>Has a superior effect on collagen and elastin rejuvenation</li><li>Multi-speed and adjustable needle depth</li><li>Highest effectiveness</li><li>Effectively treat hard-to-reach places</li><li>Promotes scar-less healing and natural collagen reproduction</li></ul><h5>Ongoing and&nbsp;long lasting results:</h5><ul><li>Cumulative results enable continuing rejuvenation for healthy-looking skin.</li><li>Target problem areas such as fine lines around the lips, eyes and frown lines.</li><li>Reduce the appearance of scars or skin damage, such as acne scars and stretch marks on the face or body.</li><li>Minimise the appearance of large pores, blackheads and milia.</li><li>Plumps up lines and deep wrinkles</li><li>Treats &amp; improves skin texture</li><li>Treats &amp; reduce crow\'s feet &amp;&nbsp;&nbsp;laugh lines</li><li>Treats &amp; reduces acne scars</li><li>Treats &amp; reduces ice pick and chickenpox scars</li><li>Treats &amp; diminishes&nbsp;hyperpigmentation</li><li>Treats &amp; diminishes&nbsp;age spots &amp; sun damaged skin</li><li>Treats &amp; diminishes &nbsp;enlarged pores</li><li>Significantly&nbsp;improves the appearance of stretch marks</li><li>boosts collagen and elastin fibres by up to 1000%</li><li>Enhances absorption of skin/hair products by up to 2000% so they are able to work more effectively.</li><li>No downtime</li><li>Painless</li></ul><h5>How does it work?</h5><p>Dr Pen consists of two parts: an electric hand piece that plugs into the wall for a stable and consistent source of power, and a 2 needle tips, each containing 12 microscopic needles. You simply click the needle cartridge into hand piece,and your Dr Pen device is ready for action.</p><p>The internal motor causes the needles in the Tip to oscillate at a rate of close to 110 revolutions per second. When the needle tip makes contact with the skin, the needles create tiny puncture in the skin\'s surface, causing micro-trauma, and inducing an immune response, and subsequently, the creation of new healthy collagen. The punctures also act as micro-channels that carry topical nutrients used during the treatment deep into skin layers for an increased effect. Because the needles oscillate as quickly as they do, the tip of the Pen easily *glides* across the skin, without catching or causing any dermal tearing.</p><p>This small, easy to operate device is able to produce similar, if not better, results to a fractional laser, without the risk of hyper or hypo-pigmentation, as well as other side effects and downtime associated with these effective, but potentially damaging ablative heat based treatments.</p><p>This kit comes with 2 needle cartridges. Each cartridge has 12 titanium needles and can be reused 3 -4 times. (Please note, cartridges should not be shared. You can of course use your Dr Pen on a clients (if you are a salon/spa owner, or a friend or family, but always use a new cartridge each time).</p><h5>Does it hurt?</h5><p>Dr Pen offers multiple needle lengths to treat your specific skin goals. They range from .2mm to 3mm. Numbing cream is not required for anything up to 1.5mm but you may find it more comfortable to ice or use a numbing cream if you are making use of the 2mm+ . Because it glides over your skin, it is much kinder on the skin and easier to use.&nbsp;</p>', '', '', 51, NULL, NULL, 'EACH', '', 0, 0, 1, '01', '01', 1, 1, 1, NULL, NULL, NULL),
