(193, 2, 'ETB1', 'Eternal Triple Black 1oz', '<pre>Eternal Tattoo Ink is now one of the most recognized and used \r\ntattoo inks throughout the tattooing world.  <br>These inks are a must for any tattoo artist.\r\n\r\n</pre>', 'eternal, triple black, ink, black', 'eternal, triple black, ink, black', 37, NULL, NULL, 'BOT(1OZ)', '', 100, 0, 1, '01', '01', 1, 1, 1, NULL, NULL, NULL),
