(208, 2, 'PO90', 'Microblading Pen', '<ul>\r\n					\r\n					\r\n						<li> \r\n							Multi-function Permanent Makeup Pen, hair stroked embroidery \r\nMicroblading Pen Excellent for Eyeliner, Eyebrows, Lip liner, Full lip \r\ncolor, scar camouflaging reconstruction and tattooing.\r\n							\r\n						</li>\r\n					\r\n						<li> \r\n							Microblading Pen with Complete functions, professional lock-pin design with 3 different tip to hold the needle or blade.\r\n							\r\n						</li>\r\n					\r\n						<li> \r\n							Eyebrow Tattoo Pen with 3 trial needles, Well packaged in a \r\nDesigned Clear box, Portable and Well organized for Daily Use.\r\n							\r\n						</li>\r\n					\r\n						<li> \r\n							This Manual Tattoo Pen suit for 7 to 17 pin blade and also the \r\nRound needle. buy asin: B01N652JTQ or B01MXMMU6S together to get 30% \r\noff.\r\n							\r\n						</li>\r\n					\r\n						<li> \r\n							This eyebrow Tattoo Pen should be used with the paste pigment to \r\nmake different colors. pigment is not included in the set\r\n							\r\n						</li>\r\n					\r\n				</ul>', 'microblading, pen, microblading pen', 'microblading, pen, microblading pen', 61, NULL, NULL, 'EACH', '', 0, 0, 1, '01', '01', 1, 1, 1, NULL, NULL, NULL),
(209, 2, 'KMC1', 'KMC Eyebrow Ruler', '<div>\r\n            <div><p>KMC Eyebrow Ruler for the symmetry of the eyebrow arches.</p>\r\n<p>It helps with the design of eyebrow arch in microblading and permanent make-up, and helps with eyelash application.</p>\r\n<p>KMC Eyebrow Ruler allows accurate measurement and eyebrow drawing. It\r\n is easy to clean. It is flexible, convenient to use. Thanks to the oval\r\n structure, it fits the face of every customer.</p></div>\r\n            \r\n                    </div>', 'KMC Eyebrow Ruler', 'KMC Eyebrow Ruler', 61, NULL, NULL, 'EACH', '', 0, 0, 1, '01', '01', 1, 1, 1, NULL, NULL, NULL),
(210, 2, 'EBR', 'Eyebrow Razor Disposable Razor', '<ul>\r\n					\r\n					\r\n						<li> \r\n							The cutter head is made of stainless steel with high sharpness, can be used to repair eyebrows.\r\n							\r\n						</li>\r\n					\r\n						<li> \r\n							The cutter head has safety net, and the safety will not hurt the skin.\r\n							\r\n						</li>\r\n					\r\n						<li> \r\n							The handle is ABS environmental material.\r\n							\r\n						</li>\r\n					\r\n						<li> \r\n							Bend the handle to allow you to trim your eyebrows easily.\r\n							\r\n						</li>\r\n					\r\n						</ul><br><br><ul>\r\n					\r\n				</ul>', 'Eyebrow Razor Disposable Razor', 'Eyebrow Razor Disposable Razor', 61, NULL, NULL, 'EACH', '', 0, 0, 1, '01', '01', 1, 1, 1, NULL, NULL, NULL),
(211, 2, 'EBC', 'Golden Mean Caliper', '<p>Golden Mean Calipers are designed to make small and accurate \r\nmeasurements for faces or geometric drawings to measure the Golden Mean,\r\n also known as The Golden Ratio and Phi, is a ratio of 1: 1.618.  This \r\ncaliper is designed specifically for work in the field of cosmetic \r\nsurgery and eyebrow microblading.  The clear acrylic does not block the \r\nline of vision to the skin underneath while still allowing for precise \r\nmeasurements.</p><p>Product Specifications:<br> – Measures the Golden Mean, also known as The Golden Ratio and Phi is a ratio of – &nbsp;  1 : 1.618<br> – Used extensively in Microblading and other beauty practices<br> – Videos and guides showing how to work using the Golden ratio can be found via Youtube<br> – Easy to clean and fully reusable</p>', 'Golden Mean Caliper', 'Golden Mean Caliper', 61, NULL, NULL, 'EACH', '', 0, 0, 1, '01', '01', 1, 1, 1, NULL, NULL, NULL),
(212, 2, 'DUR', 'Disposable Micro Applicators', '<div> \r\n <div> \r\n  <b>Description: \r\n</b> </div> \r\n <div> \r\n  <blockquote><div> \r\n   Can be arbitrary bending angle. \r\n  </div> \r\n  <div> \r\n   Disposable makeup tools, non-linting. \r\n  </div> \r\n  <div> \r\n   Very clean and sanitary, prevent infection. \r\n  </div> \r\n  <div> \r\n   Type: Disposable Eyelash Brush \r\n  </div> \r\n  <div> \r\n   Material: PVC \r\n  </div> \r\n  <div> \r\n   Quantity: 100 Pcs \r\n  </div> \r\n  <div> \r\n   Features: Disposable, Makeup Tool, Remove Cosmetic Helper \r\n  </div> \r\n  <div> \r\n   Length: 10cm/3.94\" (Approx.)</div><div> \r\n   Green One Diameter: 0.2cm/0.08\" (Approx.)&nbsp; \r\n  </div></blockquote> \r\n  <div> \r\n   <div> \r\n    <b>Package Includes: \r\n   </b></div> \r\n   <div> \r\n    1 x 100 Pcs Disposable Eyelash Brush \r\n   </div> \r\n   <div> \r\n    (Items will be safely packed in bubble bags,pls note) \r\n   </div> \r\n   <div> \r\n    Notes: \r\n   </div> \r\n   <div> \r\n    Due to the light and screen setting difference, the item\'s color may be slightly different from the pictures. \r\n   </div> \r\n   <div> \r\n    Please allow slight dimension difference due to different manual measurement. \r\n   </div> \r\n  </div> \r\n </div> \r\n</div>\r\n\r\n<br><br>', 'Mascara Brush,100pcs/lot, Durable, Micro, Disposable, Eyelash, Extension, Individual, Applicators, Mascara, Brush, For, Women,', 'Mascara Brush,100pcs/lot, Durable, Micro, Disposable, Eyelash, Extension, Individual, Applicators, Mascara, Brush, For, Women,', 61, NULL, NULL, 'EACH', '', 0, 0, 1, '01', '01', 1, 1, 1, NULL, NULL, NULL),
