(218, 2, '1473', '10mm Stainless Steel Tunnels', '<div>\r\n<div>\r\n<div>\r\n<div>\r\n<div>\r\n<div>\r\n<div>\r\n<div>\r\n<div>\r\n<div>\r\n<div>316L stainless surgical steel internally threaded eyelet. &nbsp;</div>\r\n<div>Quantity: sold as 1 pair (2 pieces)</div>\r\n<div>Style: round tunnel, 2 sides concave</div>\r\n<div>Flare: double flare, back flare screw fit</div>\r\n<div>Wearable Width: 7mm</div>\r\n<div>Size: size ordered is wearable area by mm measurement</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n\r\n\r\n<div><br></div>', '10mm Stainless Steel Tunnels, Tunnels, Stretchers', '10mm Stainless Steel Tunnels, Tunnels, Stretchers', 50, NULL, NULL, 'PAIR', '', 0, 0, 1, '01', '01', 1, 1, 1, NULL, NULL, NULL),
(219, 2, '432', 'Stack Station', '<p>The ultimate mobile tattoo station.</p><p>Perfect for any studio environment. Move comfortably around and has massive space for all your equipment.</p><p>&nbsp;Stack Station:</p><p>4 Tier Station</p><p>1 Top Station</p><p>Fully Mobile</p><p>6 Month Guarantee&nbsp;</p>', 'Work Station, Station, Tattoo, Tattoo station', 'Work Station, Station, Tattoo, Tattoo station', 53, NULL, NULL, 'EACH', '', 0, 0, 1, '01', '01', 1, 1, 1, NULL, NULL, NULL),
(220, 2, '432', 'Apex Station', '<p>The Grand Daddy of mobile tattoo station.</p><p>Apex Station is the king in Studio station equipment build out of solid steel and pure quality. It will be a constant reminder in the studio of what power looks like.<br></p><p>Apex Station:<br></p><p>5 Tier Station</p><p>1 Top Station</p><p>Solid steel construction</p><p>Industrial strengthen wheels</p><p>Fully Mobile</p>', 'Work Station, Tattoo, Apex Station', 'Work Station, Tattoo, Apex Station', 53, NULL, NULL, 'EACH', '', 0, 0, 1, '01', '01', 1, 1, 1, NULL, NULL, NULL),
(221, 2, '432', 'Steel Tier', 'Steel Tier is your everyday mobile studio station.<div>Can be used to display items or to move around studio equipment.&nbsp;</div><div>Solid build steel.</div><div><br></div><div>Steel Tier:<br></div><div>3 Tier&nbsp;</div><div>Solid Steel</div><div>Fully Mobile</div><div><br></div>', 'Steel Tier, work station, station, tattoo', 'Steel Tier, work station, station, tattoo', 53, NULL, NULL, 'EACH', '', 0, 0, 1, '01', '01', 1, 1, 1, NULL, NULL, NULL),
(222, 2, '432', 'Sweet Seat', 'Sweet Seat<div><br></div><div>Super comfortable easy to move with a full hydraulic height adjustment system.&nbsp;</div><div><br></div><div>Perfect for any studio</div><div><br></div><div>\r\n\r\nDelivery is 5-10 working days\r\n\r\n<br></div>', 'Sweet Seat', 'Sweet Seat', 53, NULL, NULL, 'EACH', '', 0, 0, 1, '01', '01', 1, 1, 1, NULL, NULL, NULL),
(223, 2, '432', 'Saddle Back', 'Saddle Back is the perfect long term tattoo chair. With great lower back support and the amazing&nbsp;Polyurethane finish, you wouldn\'t want to get off this one.<div><br></div><div>Perfect for any studio or artist.</div>', 'Saddle Back', 'Saddle Back', 53, NULL, NULL, 'EACH', '', 0, 0, 1, '01', '01', 1, 1, 1, NULL, NULL, NULL),
