    <a href=\"#\">\n                  <i class=\"ti-shopping-cart\"></i>\n                </a>\n              </div>\n            </div>\n            <div class=\"product-btm\">\n              <a href=\"#\" class=\"d-block\">\n                <h4>Red women purses</h4>\n              </a>\n              <div class=\"mt-3\">\n                <span class=\"mr-4\">$25.00</span>\n                <del>$35.00</del>\n              </div>\n            </div>\n          </div>\n        </div>\n\n        <div class=\"col-lg-4 col-md-6\">\n          <div class=\"single-product\">\n            <div class=\"product-img\">\n              <img class=\"img-fluid w-100\" src=\"/site_assets/img/product/feature-product/f-p-3.jpg\" alt=\"\" />\n              <div class=\"p_icon\">\n                <a href=\"#\">\n                  <i class=\"ti-eye\"></i>\n                </a>\n                <a href=\"#\">\n                  <i class=\"ti-heart\"></i>\n                </a>\n                <a href=\"#\">\n                  <i class=\"ti-shopping-cart\"></i>\n                </a>\n              </div>\n            </div>\n            <div class=\"product-btm\">\n              <a href=\"#\" class=\"d-block\">\n                <h4>Men stylist Smart Watch</h4>\n              </a>\n              <div class=\"mt-3\">\n                <span class=\"mr-4\">$25.00</span>\n                <del>$35.00</del>\n              </div>\n            </div>\n          </div>\n        </div>\n      </div>\n    </div>\n  </section>\n  <!--================ End Feature Product Area =================-->', 1, 1, NULL, NULL),
(4, 2, 'Contact us', '', '', '<!--================Home Banner Area =================-->\n    <section class=\"banner_area\">\n      <div class=\"banner_inner d-flex align-items-center\">\n        <div class=\"container\">\n          <div\n            class=\"banner_content d-md-flex justify-content-between align-items-center\"\n          >\n            <div class=\"mb-3 mb-md-0\">\n              <h2>Contact Us</h2>\n              <p>Very us move be blessed multiply night</p>\n            </div>\n            <div class=\"page_link\">\n              <a href=\"index.html\">Home</a>\n              <a href=\"contact.html\">Contact Us</a>\n            </div>\n          </div>\n        </div>\n      </div>\n    </section>\n    <!--================End Home Banner Area =================-->\n\n    <!-- ================ contact section start ================= -->\n  <section class=\"section_gap\">\n    <div class=\"container\">\n      <div class=\"row\">\n        <div class=\"col-12\">\n          <h2 class=\"contact-title\">Get in Touch</h2>\n        </div>\n        <div class=\"col-lg-8 mb-4 mb-lg-0\">\n          <form class=\"form-contact contact_form\" action=\"contact_process.php\" method=\"post\" id=\"contactForm\" novalidate=\"novalidate\">\n            <div class=\"row\">\n              <div class=\"col-12\">\n                <div class=\"form-group\">\n                    <textarea class=\"form-control w-100\" name=\"message\" id=\"message\" cols=\"30\" rows=\"9\" placeholder=\"Enter Message\"></textarea>\n                </div>\n              </div>\n              <div class=\"col-sm-6\">\n                <div class=\"form-group\">\n                  <input class=\"form-control\" name=\"name\" id=\"name\" type=\"text\" placeholder=\"Enter your name\">\n                </div>\n              </div>\n              <div class=\"col-sm-6\">\n                <div class=\"form-group\">\n                  <input class=\"form-control\" name=\"email\" id=\"email\" type=\"email\" placeholder=\"Enter email address\">\n                </div>\n              </div>\n              <div class=\"col-12\">\n                <div class=\"form-group\">\n                  <input class=\"form-control\" name=\"subject\" id=\"subject\" type=\"text\" placeholder=\"Enter Subject\">\n                </div>\n              </div>\n            </div>\n            <div class=\"form-group mt-lg-3\">\n              <button type=\"submit\" class=\"main_btn\">Send Message</button>\n            </div>\n          </form>\n\n\n        </div>\n\n        <div class=\"col-lg-4\">\n          <div class=\"media contact-info\">\n            <span class=\"contact-info__icon\"><i class=\"ti-home\"></i></span>\n            <div class=\"media-body\">\n              <h3>844 Haarhoff Street, Rietfontein</h3>\n              <p>Pretoria, GP 0084</p>\n            </div>\n          </div>\n          <div class=\"media contact-info\">\n            <span class=\"contact-info__icon\"><i class=\"ti-tablet\"></i></span>\n            <div class=\"media-body\">\n              <h3><a href=\"tel:454545654\">087 012 5557</a></h3>\n              <p>Mon to Fri 7am to 4pm</p>\n            </div>\n          </div>\n          <div class=\"media contact-info\">\n            <span class=\"contact-info__icon\"><i class=\"ti-email\"></i></span>\n            <div class=\"media-body\">\n              <h3><a href=\"mailto:support@colorlib.com\">info@longgud.co.za</a></h3>\n              <p>Send us your query anytime!</p>\n            </div>\n          </div>\n        </div>\n      </div>\n    </div>\n  </section>\n	<!-- ================ contact section end ================= -->', 1, 1, NULL, NULL);
